import React from "react";
import styled from "styled-components";

const box = styled.div`
  width: 100%;
  min-height: 30px;
  padding: 1rem;
  border: 1px solid gray;
  border-radius: 5px;
`;

const Todo = () => {
  return <Box></Box>;
};

export default Todo;
